              <a href="/Career">Careers</a>
            </li>
            <li>
              <a href="/Blogs">Blogs</a>
            </li>
          </ul>
        </nav>
        {/* Call to Action Button */}
        <div className="cta">
          <a href="/get-started">Get Started</a>
        </div>
      </div>
    </header>
  );
};

